import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
      <div className="car">
        <h3>Ford Focus</h3>
        <p>Year: <strong>2017</strong></p>
      </div>,
      <div className="car">
              <h3>Audi a8</h3>
          <p>Year: <strong>2015</strong></p>
          </div>
  );
}

export default App;
